import link from ""



function Page(){

    const [adicionar, setAdicionar] = useState(0);

    function Adicionar() {
        setAdicionar(adicionar + 1);
        
    }


    return (
        <div>
            <div>Hejo</div>
            <br/>
            <div>{adicionar}</div>
            <button onClick={Adicionar}>Adicionar</button><br/>
            <button link="/home">Home</button>

        </div>
    )}
export default Page;
